import React from 'react';
import { motion } from 'framer-motion';

const Footer = () => {
  return (
    <motion.footer 
      className="footer"
      initial={{ opacity: 0 }}
      whileInView={{ opacity: 1 }}
      transition={{ duration: 0.8 }}
      viewport={{ once: true }}
    >
      <div className="container">
        <div className="footer-content">
          <div>
            github: <a href="https://github.com/nainasachdev10" target="_blank" rel="noopener noreferrer">@nainasachdev10</a> | 
            linkedin: <a href="https://www.linkedin.com/in/naina-sachdev/" target="_blank" rel="noopener noreferrer">@naina-sachdev</a>
          </div>
          <div>
            twitter: <a href="https://x.com/Nainasachdev11" target="_blank" rel="noopener noreferrer">@Nainasachdev11</a> | 
            email: <a href="mailto:nainasachdev01@gmail.com">nainasachdev01@gmail.com</a>
          </div>
          <div style={{ marginTop: '0.5rem', fontSize: '0.75rem', opacity: 0.7 }}>
            portfolio web: naina.dev
          </div>
        </div>
      </div>
    </motion.footer>
  );
};

export default Footer;
